column2:
@jasvault Just because other projects failed to create a good user experience, it cannot be used as an excuse to do the same.

You have to strive to be the best in the space, and not compare with the failures of others to console yours.

It's a good learning experience at the end of day.

@NanouuSymeon I use one screen, but it's a 49" ultrawide setup. 

I have 3-4 programs open in parallel, don't have to ever switch between docs, implementation, and references.

Personally, it's highly effective and productive to be able to go hours without switching windows/using a mouse.

@madsbrodt Furthermore, you are only factoring in systems with websites.

Some of the most complicated systems do not have frontends. They solely operate in isolation such as large-scale ETL processes, blockchain indexers, analytics engines etc.

Architecture at scale is hard, hence the pay

@funghibull @DeezeFi As much as that'd be useful, it can turn out to be a lot of work.

Communication is fundamentally broken in web3 and needs a dire upgrade.

I realized this problem back in May 2021 and currently have something in the works to address it!
